requirements.comments:
Originally:

TriplexSignalMonitor shall always satisfy (single_fail_reported & failure_in_progress => set_val = preReal(0.0,set_val))

where

var C1: bool = abs (ia - ib) > Tlevel ;
var C2: bool = abs (ib - ic) > Tlevel ;
var C3: bool = abs (ia - ic) > Tlevel ;
var miscompare : bool = (not C1 and C2 and C3) or (C1 and not C2
and C3) or (C1 and C2 and not C3);
var failure_in_progress : bool = miscompare and prePC <= PCLimit
and PC > 0;

Originally:

SWIM shall always satisfy ((lowSpeedWarningAllowed  & vehAirPress < warningTrigForMinPress) => lowSpeedWarningTrue)

where

var E_SWIM_WARNING_ON : real = 1.0;
var lowSpeedWarningTrue : bool = swimGet_AgcasLowSpeedWarn =
E_SWIM_WARNING_ON ;

Originally:

TriplexSignalMonitor shall always satisfy ((pre_no_fail & failure_must_be_latched)=> single_fail_reported)

where

C1: bool = abs (ia - ib) > Tlevel ;
C2: bool = abs (ib - ic) > Tlevel ;
C3: bool = abs (ia - ic) > Tlevel ;
miscompare : bool = (not C1 and C2 and C3) or (C1 and not C2 and C3) or (C1 and C2 and not C3);
failure_must_be_latched : bool = miscompare and prePC > PCLimit;
single_fail_reported : bool = (FC =1) or (FC =2) or (FC =4);


TriplexSignalMonitor shall always satisfy ((preBool(true, no_fail) & (((!((absReal(ia - ib) > Tlevel)) & (absReal(ib - ic) > Tlevel) & (absReal(ia - ic) > Tlevel)) | ((absReal(ia - ib) > Tlevel) & !(absReal(ib - ic) > Tlevel) & (absReal(ia - ic) > Tlevel)) | ((absReal(ia - ib) > Tlevel) & (absReal(ib - ic) > Tlevel) & !(absReal(ia - ic) > Tlevel))) & preInt(0, PC) > PCLimit)) => single_fail_reported)

